import React, { useEffect, useState } from "react";
import Sidebar from "../../components/Sidebar";

const AdminAdmissions = () => {
  const [admissions, setAdmissions] = useState([]);

  useEffect(() => {
    // ✅ Fetch admissions data from backend
    fetch("http://localhost:5000/api/applications")
      .then((res) => res.json())
      .then((data) => setAdmissions(data))
      .catch((err) => console.error("Error fetching admissions:", err));
  }, []);

  return (
    <div className="layout">
      <Sidebar />

      <div className="page">
        <h1 className="pageTitle">🎓 Admissions</h1>
        <p>Here you can manage student admissions.</p>

        <table className="table">
          <thead>
            <tr>
              <th>#</th>
              <th>Student Name</th>
              <th>Course</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {admissions.length > 0 ? (
              admissions.map((admission, index) => (
                <tr key={admission._id}>
                  <td>{index + 1}</td>
                  <td>{admission.studentName}</td>
                  <td>{admission.course}</td>
                  <td>{admission.email}</td>
                  <td>{admission.phone}</td>
                  <td>{admission.status || "Pending"}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="6" style={{ textAlign: "center", padding: "20px" }}>
                  No admissions found.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>

      <style>{`
        .layout {
          display: flex;
          height: 100vh;
          font-family: Arial, sans-serif;
          background: #ecf0f1;
        }

        .page {
          flex: 1;
          padding: 30px;
          overflow-y: auto;
        }

        .pageTitle {
          font-size: 24px;
          margin-bottom: 20px;
          font-weight: bold;
        }

        table {
          width: 100%;
          border-collapse: collapse;
          margin-top: 20px;
          background: #fff;
          box-shadow: 0 2px 6px rgba(0,0,0,0.1);
          border-radius: 10px;
          overflow: hidden;
        }

        th, td {
          padding: 12px;
          border-bottom: 1px solid #ddd;
          text-align: left;
        }

        th {
          background-color: #34495e;
          color: #fff;
        }

        tr:hover td {
          background-color: #f5f5f5;
        }
      `}</style>
    </div>
  );
};

export default AdminAdmissions;
